			"privacy_statement": "คำชี้แจงสิทธิ์ส่วนบุคคล",
			"first_paragraph": "Jotun A / S และกลุ่ม บริษัท (Jotun) มุ่งมั่นที่จะการปกป้องข้อมูลส่วนบุคคลของพนักงาน Jotun และบุคคลอื่น ๆ คำชี้แจงสิทธิส่วนบุคคลนี้ (\"<strong> คำชี้แจงสิทธิ์ส่วนบุคคล </strong> \") อธิบายถึงข้อมูลที่ Jotun รวบรวมจากหรือเกี่ยวกับคุณ (\"<strong> ข้อมูลส่วนบุคคล </strong> \") และวิธีที่เราใช้และเพื่อผู้ที่เราเปิดเผยข้อมูลดังกล่าว Jotun A / S หรือ บริษัท Jotun ซึ่งควบคุมข้อมูลส่วนบุคคลเรียกว่า \"ข้อมูลตัวควบคุม” สำหรับข้อมูลส่วนบุคคลที่ดำเนินการเกี่ยวกับคุณ",
			"second_paragraph": "คำชี้แจงสิทธิ์ส่วนบุคคลนี้ได้รับการพัฒนาเพื่อระบุกิจกรรมการประมวลผลของ Jotun และแจ้งให้เจ้าของข้อมูลทราบถึงสิทธิ์ที่เกี่ยวข้องกับการปกป้องข้อมูลส่วนบุคคล",
			"third_title": "องค์กรและกลุ่มข้อมูลที่อยู่ภายใต้คำแถลงนี้",
			"third_paragraph": "\\“ Jotun\\” ประกอบด้วย บริษัท แม่ Jotun A / S และ บริษัท ย่อย การอ้างอิงทั้งหมดในคำชี้แจงสิทธิ์ส่วนบุคคลนี้ถึง \"Jotun\", \"เรา\", \"เรา\", \"ของเรา\" และข้อกำหนดที่ชอบควรได้รับการตีความตาม คำชี้แจงสิทธิ์ส่วนบุคคลนี้ใช้กับข้อมูลส่วนบุคคลของบุคคลทั้งหมดที่เป็นลูกค้าพนักงานของลูกค้าซัพพลายเออร์หรือพนักงานของซัพพลายเออร์หรือบุคคลที่ลงทะเบียนข้อมูลส่วนบุคคลของตนบน www.jotun.com (ข้อมูล\\“ <strong> ข้อมูล เรื่อง </strong>\\”)",
			"forth_title": "กรอบกฎหมายและการปฏิบัติตาม",
			"forth_paragraph": "Jotun Group ได้เข้าสู่ชุดของกฎและนโยบายการปกป้องข้อมูลซึ่งมีผลผูกพันกับทุก บริษัท ที่เรียกว่า Jotun Binding Corporate Rules (“ <strong> BCR </strong>”) โดยมีการกำหนดนโยบายขั้นตอนและแนวทางปฏิบัติที่เกี่ยวข้องเพื่อให้สอดคล้องกับ General Data Protection Directive (EU) 2016/679 ( \"<strong> GDPR </strong>\") ใบสมัคร BCR ถูกส่งไปยังและกำลังอยู่ในการจัดการโดยหน่วยงานคุ้มครองข้อมูลของนอร์เวย์ในฐานะผู้มีอำนาจนำ ด้วยกฎการปกป้องข้อมูลทั่วไปใน Jotun เรามั่นใจว่ามีการป้องกันในระดับที่เพียงพอสำหรับเจ้าของข้อมูลทั้งหมดรวมถึงเมื่อข้อมูลส่วนบุคคลถูกถ่ายโอนระหว่าง บริษัท ในกลุ่มต่างๆไปยังประเทศต่างๆ Jotun มีภาระผูกพันที่จะต้องปฏิบัติตามกฎหมายว่าด้วยความเป็นส่วนตัวภายในแต่ละประเทศที่เราดำเนินงาน บางครั้งกฎหมายนี้และ / หรือสิทธิ์ของเจ้าของข้อมูลในการปกป้องข้อมูลจะแตกต่างกันไปในแต่ละประเทศ เจ้าของข้อมูลรักษาสิทธิ์ใด ๆ ที่มีภายใต้กฎหมายท้องถิ่น คำชี้แจงสิทธิส่วนบุคคลนี้จะใช้เฉพาะในกรณีที่ให้ความคุ้มครองเพิ่มเติม ในกรณีที่กฎหมายท้องถิ่นให้ความคุ้มครองมากกว่าคำชี้แจงสิทธิ์ส่วนบุคคลนี้ให้ใช้กฎหมายท้องถิ่น",
			"fifth_title": "ข้อมูลส่วนบุคคลคืออะไร",
			"fifth_paragraph": "ข้อมูลส่วนบุคคลคือข้อมูลใด ๆ ที่เกี่ยวข้องกับบุคคลที่สามารถใช้เพื่อระบุตัวตนได้ทั้งทางตรงและทางอ้อม อาจเป็นอะไรก็ได้ตั้งแต่ชื่อรูปถ่ายที่อยู่อีเมลรายละเอียดธนาคารโพสต์บนเว็บไซต์เครือข่ายสังคมข้อมูลทางการแพทย์หรือที่อยู่ IP ของคอมพิวเตอร์ ข้อมูลส่วนบุคคลไม่รวมถึงข้อมูลที่ไม่ระบุตัวตนหรือไม่ใช่ข้อมูลส่วนบุคคล (กล่าวคือข้อมูลที่ไม่สามารถเชื่อมโยงหรือติดตามกลับไปยังบุคคลใดบุคคลหนึ่งได้)",
			"sixth_title": "สำหรับวัตถุประสงค์ทางธุรกิจที่เรารวบรวมข้อมูลส่วนบุคคล",
			"sixth_paragraph": "ข้อมูลส่วนบุคคลของเจ้าของข้อมูลจะถูกรวบรวมใช้หรือประมวลผลอย่างอื่นเพื่อวัตถุประสงค์ทางธุรกิจหนึ่ง (หรือมากกว่า) ดังต่อไปนี้: <br />",
			"sixth_li_01": "วัตถุประสงค์ในการจัดหาพัฒนาและปรับปรุงผลิตภัณฑ์และ / หรือบริการ",
			"sixth_li_02": "ข้อสรุปและการปฏิบัติตามข้อตกลงกับลูกค้าซัพพลายเออร์และพันธมิตรทางธุรกิจ",
